
CREATE TABLE `dolgozok` (
  `azonosito` int(11) NOT NULL,
  `nev` varchar(40) CHARACTER SET utf8 COLLATE utf8_hungarian_ci NOT NULL,
  `szulido` date NOT NULL,
  `ferfi` binary(1) NOT NULL,
  `lakcim` varchar(40) CHARACTER SET utf8 COLLATE utf8_hungarian_ci NOT NULL,
  `reszleg` varchar(20) CHARACTER SET utf8 COLLATE utf8_hungarian_ci NOT NULL,
  `belepes_datum` date NOT NULL,
  `vegzettseg` varchar(20) CHARACTER SET utf8 COLLATE utf8_hungarian_ci NOT NULL,
  `alapber` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




ALTER TABLE `dolgozok`
  ADD PRIMARY KEY (`azonosito`);
